function dateToUnix(year, month, date, hour, minute, second, millisecond) {
  const jsDate = new Date(year, month - 1, date, hour, minute, second, millisecond);
  return {
    seconds: Math.floor(jsDate.getTime() / 1000),
    milliseconds: jsDate.getTime()
  };
}

function padNumber(num, size) {
  return num.toString().padStart(size, '0');
}

