function unixToDate(timestamp, unit = 'seconds') {
  let milliseconds;
  switch (unit) {
    case 'seconds':
      milliseconds = timestamp * 1000;
      break;
    case 'milliseconds':
      milliseconds = timestamp;
      break;
    case 'microseconds':
      milliseconds = timestamp / 1000;
      break;
    default:
      throw new Error('Invalid unit');
  }

  const date = new Date(milliseconds);
  return date.toLocaleString('en-US', { 
    year: 'numeric', 
    month: '2-digit', 
    day: '2-digit',
    hour: '2-digit', 
    minute: '2-digit', 
    second: '2-digit', 
    hour12: true 
  });
}

